import React from "react";

import { frame } from "../../utils/Constant";

const Frame = (props) => {
  const width = props.width || "w-full";
  return (
    <div className={`Frame ${width} h-auto`}>
      <div className="inline-flex flex-col ">
        <div className="inline-flex ring-1 flex-row-4 ">
          {frame.map((k, i) => {
            return <span key={i}>{k.title}</span>;
          })}
        </div>
        <div className="inline-flex ring-1 flex-row-4 display:block"></div>
      </div>
    </div>
  );
};

export default Frame;
